kind = "service-resolver"
name = "api"

# Using a default_subset will route traffic to the subset specified in the value when no traffic-splitter is present. 

default_subset = "v1"

subsets = {
  v1 = {
    filter = "Service.Meta.version == 1"
  }
  v2 = {
    filter = "Service.Meta.version == 2"
  }
}

kind = "service-splitter",
name = "api"

splits = [
  {
    weight = 99,
    service_subset = "v1"
  },
  {
    weight = 1,
    service_subset = "v2"
  }
]

kind = "service-splitter",
name = "api"

splits = [
  {
    weight = 50,
    service_subset = "v1"
  },
  {
    weight = 50
    service_subset = "v2"
  }
]

kind = "service-splitter",
name = "api"

splits = [
  {
    weight = 0,
    service_subset = "v1"
  },
  {
    weight = 100
    service_subset = "v2"
  }
]

kind = "service-router",
name = "api"

routes = [
  {
    match {
      http {
        path_prefix="/v1"
      }
    }

    destination {
      service = "api"
      service_subset = "v1"
    }
  },
  {
    match {
      http {
        path_prefix="/v2"
      }
    }

    destination {
      service = "api"
      service_subset = "v2"
    }
  },
]
